import React, { useState } from 'react'
import cardTurn from './cardTurn'

function Maingame() {
  const [mainGame, setMainGame] = useState(["","",])

  return (
    <div>
      <cardTurn val={mainGame[0]}/>
      <cardTurn val={mainGame[1]}/>
    </div>
  )
}

export default Maingame
